const api_key = "cad15e9b";
const api_url = `http://www.omdbapi.com/?apikey=${api_key}`;

function App() {
  let getMoviesData = async function () {
    let response = await fetch(api_url + "&s=superman");
    let data = await response.json();
    if (data.Response) {
      return data;
    } else {
      return "error";
    }
  };

  return <h2>Hello From App {getMoviesData()}</h2>;
}
export default App;
